from sklearn.linear_model import LinearRegression
from sklearn.ensemble import RandomForestRegressor, GradientBoostingRegressor
from sklearn.compose import make_column_transformer
from sklearn.linear_model import LogisticRegression
from sklearn.metrics import accuracy_score, mean_squared_error as MSE
import re
import xgboost as xg
from sklearn.model_selection import learning_curve
from sklearn.model_selection import cross_val_score, KFold, train_test_split

onehot_encoder = OneHotEncoder(sparse_output=False)
scaler = StandardScaler()

"""# Step 1: reading data and prepairing for model

## reading data
"""

df = pd.read_csv('data.csv')
df

"""## preparing data
* remove NaN cpus (Because cpu is a key feature)
* remove data that are lack of hard (ssd and hard NaN)
* set 0 to unified graphic cards
* elicit number from space and remove `gb` or `tb`
* set `x tb` to `x * 1024 gb`
* replace NaN screen sizes with average of screen sizes
* convert rials to tomans in some case (using guess)
* remove outlier prices
* one-hot encode `cpu` type
"""

to_drap_indexes = []
for i, row in df.iterrows():
  if row['cpu'] is np.NaN:
    to_drap_indexes.append(i)
    continue
  if row['hdd'] is np.NaN and row['ssd'] is np.NaN:
    to_drap_indexes.append(i)
    continue

  if row['graphic_ram'] == 'unified':
    row['graphic_ram'] = "0"
  for col in ['hdd', 'ssd', 'ram', 'graphic_ram']:
    if row[col] is np.NaN:
      row[col] = "0"
    try:
      space = re.findall(r'\d+', row[col])[0]
      if 'tb' in row[col]:
        space = int(space) * 1024
    except Exception as e:
      print(e)
      print(row[col])
    row[col] = space
  df.loc[i] = row

  if row['screen_size'] is np.NaN:
    continue
  try:
    row['screen_size'] = float(row['screen_size'].replace("inch", "").strip())
  except Exception as e:
    print(row['screen_size'])

  if float(row['price']) / 1000000 > 1000:
    row['price'] = row['price'] // 10

  df.loc[i] = row

df = df.drop(index=to_drap_indexes)
df['hdd'] = df['hdd'].astype(str).astype(float)
df['ssd'] = df['ssd'].astype(str).astype(float)
df['ram'] = df['ram'].astype(str).astype(float)
df['graphic_ram'] = df['graphic_ram'].astype(str).astype(float)

avg = np.nanmean(df['screen_size'])
for i, row in df.iterrows():
  if row['screen_size'] is np.NaN:
    row['screen_size'] = avg
  df.loc[i] = row
df['screen_size'] = df['screen_size'].astype(str).astype(float)
df

"""Outlier data with box plot
![1 0MPDTLn8KoLApoFvI0P2vQ.webp](data:image/webp;base64,)
"""

plt.boxplot(df['price'])
plt.show()

for x in [
      'price',
    ]:
    q75,q25 = np.percentile(df.loc[:,x],[75,25])
    intr_qr = q75-q25

    max = q75+(1.5*intr_qr)
    min = q25-(1.5*intr_qr)
    print(max, min)

    df.loc[df[x] < min,x] = np.nan
    df.loc[df[x] > max,x] = np.nan

df = df.dropna()

cols_to_encode = [
    'cpu'
]

new_encoded_cols_names = []

# Create a list of new columns names
for col in cols_to_encode:
    new_encoded_cols_names += [f"is_{category}" for category in df[col].unique().tolist()]

# Inititalize and fit One Hot Encoder class from sklearn
one_hot_encoder = OneHotEncoder(sparse_output = False, handle_unknown = 'ignore')
encoded_cols = one_hot_encoder.fit_transform(df[cols_to_encode])

# As the output of the above transformer would be a sparse matrix, we need to convert it back to Pandas data frame
df_encoded = pd.DataFrame(encoded_cols, columns = new_encoded_cols_names)
df_encoded = df_encoded.reset_index()
df = df.reset_index()
df_one_hot_encoded = pd.concat([df.drop('index', axis=1), df_encoded.drop('index', axis=1)], axis=1)

df = df_one_hot_encoded.drop(cols_to_encode, axis=1)
df

Y = df['price']
X = df.drop(['price', 'stock_status'], axis=1)
X

xtrain, xtest, ytrain, ytest=train_test_split(X, Y, test_size=0.1)

"""# Step 2: modeling

## plotting and getting scores
"""

models = {
    "XGB": xg.XGBRegressor(verbosity=0, n_estimators=5000, max_depth=18),
    "LR": LinearRegression(),
    "RF": RandomForestRegressor(n_estimators=5000),
}

for model_name, model in models.items():
  print(f"---------------- {model_name} ----------------")

  model.fit(xtrain, ytrain)
  ypred = model.predict(xtrain)
  mse = MSE(ytrain, ypred)
  print("MSE OF TRAIN DATASET: %f" % mse)

  ypred = model.predict(xtest)
  mse = MSE(ytest, ypred)
  print("MSE OF TEST DATASET: %f" % (mse))

  kfold = KFold(n_splits=5, shuffle=True)
  kf_cv_scores = cross_val_score(model, X, Y, cv=kfold )
  print("K-fold CV average score: %.2f" % kf_cv_scores.mean())

  train_size_abs, train_scores, test_scores = learning_curve(model, X, Y, train_sizes=[0.3, 0.6, 0.9])
  x = []
  y = []
  for train_size, cv_train_scores, cv_test_scores in zip(
      [0.3, 0.6, 0.9], train_scores, test_scores
  ):
    x.append(train_size)
    y.append(cv_test_scores.mean())

  plt.plot(x,y)
  plt.xlabel("Train Percents")
  plt.ylabel("Scores")
  plt.show()

  print("-----------------------------------------------")

